import {     Button, TextField, styled } from '@mui/material'
import React from 'react'

import Fingerprint from '@mui/icons-material/Fingerprint';
import IconButton from '@mui/material/IconButton';
import { Link } from 'react-router-dom'

function Login() {
    const useStyle = styled(Button)({
       
        button:{
            color:"black",
           ' &:hover':{
                color:"green",
            }

        }
    })
    const myclass = useStyle();
  return (
    <>
    <div className="main-auth">
    <div className="register">
        <h1>Login</h1>
        <div className="regi-form">
       
        <TextField  className='reg-from-input' id="standard-basic" label="Email" variant="standard" />
        <TextField
          id="standard-password-input"
          label="Password"
          type="password" className={myclass.textField} 
          autoComplete="current-password"
          variant="standard"
        />    
        <Link to="/">
      <IconButton aria-label="fingerprint" color="success">
  <Fingerprint className={myclass.button}
 />

</IconButton>
        </Link> 
        
        
           </div>
        <p>Don't have an account?</p>
        <Link to="/login" className="auth-link" >Register</Link>
    </div>
   </div>
    </>
  )
}

export default Login
